import * as topojson from "topojson";

export async function fetchCountries(visuals) {
  const response = await fetch(visuals.geomap.url);
  const geodata = await response.json();

  const collection = topojson.feature(geodata, geodata.objects.countries);
  return collection.features.filter((country) => country.id !== "010");
}
